import React from "react";
import TableIPManagement from "../common/TableIPManagement";
import CreateIp from "./CreateIp";

export default function Dashboard() {
  return (
    <div style={{ padding: 40 }}>
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          margin: "-20px 0 16px",
        }}
      >
        <h1 style={{ margin: 0, opacity: 0.84 }}>Dashboard</h1>
        <CreateIp />
      </div>
      <TableIPManagement />
    </div>
  );
}
